// Imports
import React from 'react';
import './nav.css';

const Navbar = () => {
    return (
        <nav className = 'nav'>
            <div className = 'nav-content'>
                <a className = "nav-items">

                    {/* Saved Events */}
                    <a>
                            Saved Events
                    </a>

                    {/* Search Bar */}
                    <a>
                        Search Bar
                    </a>

                    {/* Logout */}
                    <a>
                            Logout

                    </a>
                </a>
            </div>
        </nav> 
    )
};

// Export
export default Navbar;
